insert into Products values('133106062','SPL01','CT16','RT01', 'Đầm đẹp dự tiệc thiết kế dáng xòe cao cấp họa tiết trắng đen sang trọng thời trang eo tôn dáng che bụng','https://salt.tikicdn.com/cache/280x280/ts/product/99/95/69/8655a48d569f8d70d096b0af19cab232.jpg', 1237700,'<p>Đến với đầm thiết kế của shop không đơn thuần chỉ là đầm công sở,mà có có những chiếc váy dự tiệc cao cấp chúng tôi muốn mang lại vẻ đẹp tuyệt đối cho chị em phụ nữ, sự tự tin, niềm hạnh phúc làm chủ cuộc sống của chính mình.</p>
<p>Địa chỉ: 60/76 Lý Chính Thắng P8 Quận 3 ( Mở cửa 8h-21h30 hàng ngày)</p>
<p>MÔ TẢ SẢN PHẨM</p>
<p>Chất liệu: Kate cao cấp</p>
<p>Quy cách: may 2 lớp, dài váy 85 - 87cm</p>
