insert into Products values('133106055','SPL01','CT16','RT01', 'Đầm voan hoa dáng xòe thiết kế đẹp cổ v màu hồng phai rất sang chảnh hợp đi tiệc đi làm - Thời trang Lux W','https://salt.tikicdn.com/cache/280x280/ts/product/76/0f/6b/d376e5b04b4ef8d7457b2cb6a607ef72.jpg', 1237700,'<p>Đầm voan hoa dáng xòe thiết kế đẹp cổ v màu hồng phai rất sang chảnh hợp đi tiệc đi làm</p>
<p>(*) SHOP SẴN LÒNG ĐỔI SIZE HOẶC ĐỔI MẪU NẾU KHÔNG VỪA, KHÔNG HỢP, TRẢ HÀNG NẾU SP BỊ LỖI</p>
<p>Cam kết sản phẩm như hình, màu sắc độ lệch 3% tùy vào thiết bị điện thoại khách sử dụng.</p>
