insert into Products values('33290473','SPL01','CT16','RT01', 'Ba Lô Chống Trộm Đa Năng Không Thấm Nước Mark RYDEN 20 - 35L','https://salt.tikicdn.com/cache/280x280/ts/product/bb/a3/60/8db2f722b958efb23069daf348964f7f.jpg', 1237700,'<p style="text-align: center;"><iframe src="//www.youtube.com/embed/akURk2DOqZI" width="560" height="314" allowfullscreen="allowfullscreen"></iframe></p>
