insert into Products values('40334263','SPL01','CT16','RT01', 'Đồng Hồ Nam Timex TW4B11300 Expedition Scout 43 Với Dây Da','https://salt.tikicdn.com/cache/280x280/ts/product/ee/2f/18/683127fa8beb5a25c0a529948a255e45.jpg', 1237700,'<div id="prodDetails">
<h3 id="hmenuid1"><strong>Xuất xứ của thương hiệu đồng hồ Timex</strong></h3>
<p>Thương hiệu đồng hồ Timex được thành lập từ năm 1854 bởi Waterbury Clock ở thung lũng Connecticut's Naugatuck (Mỹ). Đồng hồ Timex được biết đến trong thế kỉ XIX với danh nghĩa "đồng hồ Thụy Sỹ của người Mỹ" với mục tiêu cung cấp cho người dân Mỹ đồng hồ thiết kế đẹp như đồ châu Âu với giá rẻ.</p>
<p>Vào năm 1880, chiếc đồng hồ bỏ túi đầu tiên được sản xuất trong Thế chiến thứ 1, sau đó nó được sản xuất hàng loạt và trở nên phổ biến. Đồng hồ Timex được sử dụng bởi các nhân vật nổi tiếng như Tổng Thống Mỹ Bill Clinton, George W. Bush hay Steve Carell, Mark Wahlberg và Chuck Norris.</p>
<p>Hiện nay, Timex còn sở hữu hàng loạt thương hiệu lừng danh như GC, Guess, Nautica, Opex, Salvatore Ferragamo, Versace và V</p>
<p><strong>Hướng dẫn bảo quản</strong></p>
<ul>
<li>Tránh để đồng hồ nơi nhiệt độ thay đổi đột ngột</li>
<li>Tránh va chạm và tiếp xúc với chất ăn mòn, nhiệt độ cao hoặc từ trường mạnh</li>
<li>Không chỉnh nút chỉnh giờ khi đồng hồ bị ướt</li>
<li>Làm sạch đồng hồ theo định kỳ bằng vải mềm hơi ẩm để gia tăng tuổi thọ đồng hồ.</li>
</ul>
<p>Model năm: 2017<br />Hình dạng sản phẩm: Tròn<br />Màn hình hiển thị: Analog<br />Chất liệu vỏ: Đồng thau<br />Đường kính vỏ: 43 mm<br />Chất liệu dây: Da<br />Độ dài dây: Tiêu chuẩn nam<br />Độ rộng dây: 20 mm<br />Màu sắc dây: Nâu<br />Màn hình số màu: Đen<br />Chất liệu bezel: Đồng thau<br />Chịu nước ở độ sâu: 165 feet<br />Tên thương hiệu: Timex<br />Số model: TW4B11300<br />Mã sản phẩm: TW4B113009J<br />Móc khóa: Khóa<br />Độ dày vỏ: 11 mm<br />Trọng lượng sản phẩm: 2.4 Ounces</p>
</div>
