  <p>Precise 21-jewel Japanese-automatic movement; functions without a battery; powers automatically with the movement of your arm</p>
  <p>Durable mineral hardlex crystal; brushed and polished gold-tone stainless steel case and bracelet</p>
  <p>Day function in english and spanish; date function</p>
  <p>Gold dial with gold-tone hands and hour markers; sweeping second hand; luminous; exhibition case back</p>
  <p>Water resistant to 99 feet (30 M): withstands rain and splashes of water, but not showering or submersion</p>
  <p></p>
  <p>The Seiko Men's Gold-Toned Watch is formal without being too ornate or stuffy. The broad flat links of the bracelet-style band and matching case, the entire bezel, dial, hour markers and hands are all gold-toned stainless steel. What keeps this from being over-the-top is its simple, straightforward design. Winding and replacing batteries are never an issue because the Seiko has automatic movement--all you have to do is wear it. Other features include luminous hour markers, water-resistance to 99 feet (30 meters), a 60-second subdial, a durable mineral crystal, and a fold-over clasp that locks for security. This Seiko offers functionality, quality, and durability in an attractive design with plenty of class.</p>
  <p>The Seiko Men's Gold-Toned Watch is formal without being too ornate or stuffy. The broad flat links of the bracelet-style band and matching case, the entire bezel, dial, hour markers and hands are all gold-toned stainless steel. What keeps this from being over-the-top is its simple, straightforward design. Winding and replacing batteries are never an issue because the Seiko has automatic movement--all you have to do is wear it. Other features include luminous hour markers, water-resistance to 99 feet (30 meters), a 60-second subdial, a durable mineral crystal, and a fold-over clasp that locks for security. This Seiko offers functionality, quality, and durability in an attractive design with plenty of class.</p>
  <p>From Humble beginnings, Kintaro Hattoris Vision for Seiko has become reality. A consuming passion for excellence - imprinted in our Corporate DNA passed from generation to generation. Seiko, for 125 years committed to the art and science of time.</p>
  <p>A culture of innovation connects a 19th century Tokyo clock shop with 20th century advances in timekeeping to an extraordinary 21st century "quiet revolution." Continually driven by dedication and passion, established a multitude of worlds first technologies transforming the principles of timekeeping.</p>
  <p>The first quartz wristwatch  changed the history of time.</p>
  <p>The first Kinetic  marked a new era in quartz watch technology.</p>
  <p>In 1969, Seiko Astron, the first quartz wristwatch - was introduced.</p>
  <p>In an instant, Seiko exponentially improved the accuracy of wristwatches And Seiko technology firmly established todays standard in Olympic and sports timing.</p>
  <p>1984, another celebrated first  Kinetic Technology  powered by body movement.</p>
  <p>Kinetic  a quartz mechanism with unparalleled accuracy the driving force behind more worlds firsts.</p>
  <p>Kinetic Chronograph  the next generation of high performance timekeeping.</p>
  <p>Kinetic Auto Relay  automatically resets to the correct time.</p>
  <p>Kinetic Perpetual - combining the date perfect technology of perpetual calendar with the genius of Kinetic Auto Relay.</p>
  <p>And now Kinetic Direct Drive  move, and the watch is powered automatically. Or hand wind it and see the power you are generating in real time.</p>
  <p>In the realm of fine watches, time is measured by Seiko innovation  A heritage of dedication to the art and science of time.</p>
