  <p>Imported</p>
  <p>Shock Resistant, 200 Meter Water Resistant. Case diameter : 45 mm</p>
  <p>EL Backlight with Afterglow, Multi-function Alarm, 1/100 second stopwatch. TO set time and Date: A while in the Timekeeping Mode. The seconds digits flash on the display because they are selected 2. Press C to change the selection in the following sequence</p>
  <p>Countdown Timer, Auto-repeat function, Hourly Time Signal, Auto Calendar (pre-programmed until the year 2039)</p>
  <p>If you do not operate any button for a few minutes while a selection is flashing. the flashing stops and the watch goes back to the timekeeping mode automatically</p>
  <p>In an effort to avoid the navigation buttons being pushed accidentally they are purposely designed to be a bit harder to push in. This is not a defect or flaw.</p>
  <p></p>
  <p>A slapshot by a professional hockey player was all it took to send this G-Shock into history and into a goalie’s mitt, literally. If it can handle a slapshot, it can handle your life. We like to refer to it as the quintessential G-Shock.</p>
  <p>The simply designed Casio G-Shock Classic digital watch for men offers shock resistance that's great for your most vigorous sporting activities. The durable rectangular black watch case measures 45mm wide (1.77 inches), and it's matched to a comfortable black resin sports strap. It includes a stopwatch function that can measure events down to 1/100 of a second for the first 60 minutes (and down to 1 second from 60 minutes to 24 hours), and it offers elapsed and split time modes, and 1st-2nd place times. It also has a countdown timer with a 24-hour range. Other timekeeping features include a multi-function alarm, hourly time signal (which can be turned off), and 12/24-hour formats. This timepiece also features an Auto Calendar (pre-programmed until the year 2039), ±15-second accuracy per month, Afterglow backlighting, and water resistance to 200 meters (660 feet)--which will stand up to the rigors of recreational scuba diving.</p>
  <p>With the launch of its first watch in November 1974, Casio entered the wristwatch market at a time when the watch industry had just discovered digital technology. As a company with cutting-edge electronic technology developed for pocket calculators, Casio entered this field confident that it could develop timepieces that would lead the market.</p>
  <p>Today, Casio is focusing its efforts on solar-powered radio-controlled watches: the built-in solar battery eliminates the nuisance of replacing batteries, atomic timekeeping means the users never have to reset the time. Recently, Casio launched a series of Bluetooth watches that sync to the users cell phone to automatically update the time. Casio is always moving time forward.</p>
  <p></p>
