insert into Products values('40316132','SPL01','CT16','RT01', 'Đồng Hồ Cơ Tự Động Invicta 8928 Pro Diver Bằng Thép Không Gỉ Mạ Vàng Và Bạc','https://salt.tikicdn.com/cache/280x280/ts/product/36/02/21/6219f043376ee7489fdaf98704f2daa8.jpg', 1237700,'<p><strong><img style="display: block; margin-left: auto; margin-right: auto;" src="https://salt.tikicdn.com/ts/tmp/83/e6/0f/e03dad852cc73d8fa430e8309723933f.jpg" alt="Đồng Hồ Tự Động Invicta 8928 Pro Diver Bằng Thép Không Gỉ Với 2 Tông Màu" width="750" height="231" /></strong></p>
<p><strong>Invicta</strong> là thương hiệu thời trang đồng hồ của Mỹ, được thành lập hơn một thế kỷ trước năm 1837 tại Chiasso, Thụy Sỹ bởi Raphael Picard ở La Chaux-de-Fonds, ông là người Thụy Sỹ. Tên thương hiệu <strong>Invicta</strong> là 1 từ tiếng Latin có nghĩa là “<strong>Invincible</strong>” (Vô địch)</p>
<p><strong>Đồng Hồ Cơ Tự Động Invicta 8928</strong> nằm trong bộ sưu tập <strong>Pro Diver</strong> của<strong> Invicta. </strong></p>
<ul>
<li>Chiếc đồng hồ thể thao nhưng tinh tế này có vỏ bằng thép không gỉ mạ vàng và bạc</li>
<li>Mặt đồng hồ được bảo vệ bởi một lớp mineral crystal chống phản xạ với kính lúp.</li>
<li>Mặt số màu xanh sống động có các kim và vạch chỉ thời gian dễ đọc, có chức năng hiển thị ngày vào vị trí 3 giờ.</li>
<li>Chuyển động 21 viên ngọc tự động vừa chống sốc vừa đáng tin cậy, có khả năng chống nước ở độ sâu 200 mét (660 feet).</li>
</ul>
<p style="text-align: center;"><img src="https://salt.tikicdn.com/ts/tmp/e3/ab/2a/900cdf8cf4482c62ae971e80e1377bc4.jpg" alt="Đồng Hồ Tự Động Invicta 8928 Pro Diver Bằng Thép Không Gỉ Với 2 Tông Màu" width="704" height="217" /></p>
<p><strong>Các mẫu đồng hồ thuộc dòng Driver của Invicta được trang bị nút ấn để ngăn nước xâm nhập. </strong></p>
<p>Để điều chỉnh ngày và/hoặc thời gian, trước tiên bạn phải tháo nút ấn trước, sau đó nhẹ nhàng kéo nút ở khớp thứ nhất và thứ hai để điều chỉnh giờ và phút. Để làm điều này, chỉ cần xoay nút ấn ngược chiều kim đồng hồ cho đến khi nút mở lò xo. Khi bạn đã cài đặt thời gian xong, đẩy nút ấn vào và vặn thật chặt theo chiều kim đồng hồ. <strong>Không thực hiện đúng các bước trên có thể ảnh hưởng đến độ chống nước của sản phẩm.</strong></p>
<p><strong>Đồng Hồ Invicta 8928 là một chiếc đồng hồ tự động.</strong></p>
<p><strong>Đồng Hồ Invicta 8928</strong> tự động hoạt động mà <strong>không cần sử dụng pin</strong>. Còn được gọi là tự lên dây cót, đồng hồ có chuyển động tự động bằng cách sử dụng động năng. Sự chuyển động từ cánh tay của bạn sẽ cung cấp năng lượng cho roto dao động để giữ cho đồng hồ tích tắc. Để giữ cho đồng hồ hoạt động chính xác, bạn nên đeo đồng hồ thường xuyên (từ 8 đến 12 giờ mỗi ngày).</p>
<p>Model năm: 2013</p>
<p>Hình dạng sản phẩm: Tròn</p>
<p>Màn hình hiển thị: Analog</p>
<p>Chất liệu vỏ: Thép không gỉ hai tông màu</p>
<p>Đường kính vỏ: 40 mm</p>
<p>Chất liệu dây: Thép không gỉ</p>
<p>Độ dài dây: Nam</p>
<p>Độ rộng dây: 20 mm</p>
<p>Màu sắc dây: Bạc</p>
<p>Màu sắc màn hình số: Xanh dương</p>
<p>Chất liệu bezel: Thép không gỉ hai tông màu</p>
<p>Chịu nước ở độ sâu: 660 feet</p>
<p>Tên thương hiệu: Invicta</p>
<p>Số model: INVICTA-8928</p>
<p>Mã sản phẩm: 8928</p>
<p>Khóa: Khóa gập an toàn</p>
<p>Độ dày vỏ: 13 mm</p>
<p>Tính năng đặc biệt: Chống nước</p>
<p>Chất liệu màn hình số: Khoáng</p>
<p>Chức năng bezel: Đơn hướng</p>
<p>Lịch: Ngày</p>
<p>Bộ máy: Tự động Thụy Sĩ</p>
<p>Trọng lượng sản phẩm: 5.64 Ounces</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>',20, 'null', 'null','Việt Nam', 'Việt Nam', 'ChinSu', 21/01/2030  )
insert into Products values('51401869','SPL01','CT16','RT01', 'Oakley Men's OO9417 Holbrook XL Square Sunglasses','https://salt.tikicdn.com/cache/280x280/ts/product/17/09/db/b04900f6ecdef8f1480f552df3477453.jpg', 1237700,'<html>
 <head></head>
 <body>
  <p></p>
  <p>Taking inspirational cues from classic film and music stars, the Oakley Holbrook XL sunglasses never look out of place. Plutonite Material lenses filters out 100% UV rays. Prizm lens treatment controls light transmissions for maximized contrast and clarity. Polarized lenses on certain models helps to cut glare; see color name for details. Six-base lens curvature offers optimized peripheral vision and side protection. Offers the protection and impact resistance that meets ANSI Z87.1 basic impact standards. O Matter frames are formulated for high durability and high flexibility for improved safety during impact. Maintains resistance to ultra-violet radiation, humidity, thermal shock, and chemical exposure. Three-Point Fit system holds lenses in precise optical alignment for supreme comfort and performance. Metal bolt accents on front of frame. Metal Oakley icon accents on side arms.</p>
  <p>Oakley was created for world-class athletes, those who see the limits of possibility as just another challenge. Their dedication drives the brand to look beyond the conventional ideas of industry standards. It's in Oakley's DNA to identify problems, create inventions, and wrap those inventions in art. And simply to make things better than anyone thought possible. Decades of Oakley innovation have been awarded more than 540 patents that elevate physics to the level of art. Technologies transcend sports to enhance the lives of consumers, and more than 110 countries now enjoy a full array of market-leading products including premium sunglasses, goggles, prescription eyewear, apparel, footwear and accessories. These products represent Oakley's commitment to excellence - a passion that redefines what is possible for those who defy their own limits.</p>
  <p></p>
  <p> </p>
