insert into Products values('40324469','SPL01','CT16','RT01', 'Đồng Hồ Casio EFA120D-1AV Màn Hình Kỹ Thuật Số Analog Kiêm Nhiệt Kế','https://salt.tikicdn.com/cache/280x280/ts/product/6f/4c/a6/3232e5eca7698febaf16a4b46d2c30e4.jpg', 1237700,'<p> Model năm: 2011<p>Hình dạng sản phẩm: Hình vuông<p>Màn hình hiển thị: Kỹ thuật số Analog <p>Chất liệu vỏ: Thép không gỉ<p>Đường kính vỏ: 46.2 mm<p>Chất liệu dây: Thép không gỉ<p>Độ dài dây: Nam<p>Độ rộng dây: 40.1 mm<p>Màu sắc dây: Bạc<p>Màu sắc màn hình số: Đen<p>Chất liệu bezel: Thép không gỉ<p>Chịu nước ở độ sâu: 330 feet<p>Tên thương hiệu: Casio<p>Số model: EFA120D-1AV<p>Mã sản phẩm: EFA120D-1AV<p>Móc khóa: Gấp-quá-kẹp-với-hai-nút bấm-an toàn<p>Độ dày vỏ: 12.7 mm<p>Tính năng đặc biệt: Sáng<p>Chất liệu màn hình số: Khoáng<p>Chức năng bezel: Văn phòng phẩm<p>Lịch: Thứ, ngày và tháng<p>Bộ máy: Thạch anh Nhật Bản<p>Trọng lượng sản phẩm: 4.96 Ounces<p>  <p>Hàng nhập khẩu <p>Nhiệt kế; Chống nước 100 mét; Đèn nền EL tự động với chế độ Afterglow; Giờ thế giới, 30 múi giờ (50 thành phố); Hiển thị mã thành phố; Bật/Tắt tiết kiệm ánh sáng ban ngày; Báo thức hàng ngày; Hẹn giờ đếm ngược<p>Đồng hồ bấm giờ kép 1/100 giây, 1/100 giây (trong 60 phút đầu tiên), tín hiệu thời gian hàng giờ; Lịch tự động (được lập trình trước cho đến năm 2099); Định dạng 12/24 giờ; Pin SR927W x 2. Tuổi thọ pin: 2 năm, Module 4334<p>  <p>Với sự kết hợp màn hình số Analog, bạn có thể thấy thời gian ở tối đa 2 múi giờ và tính năng giờ thế giới có nghĩa là bạn sẽ không bao giờ phải đoán sự chênh lệch về thời gian giữa vị trí bạn đang ở và nhà của bạn. Thêm chức năng nhiệt kế, đồng hồ bấm giờ kép và chiếc đồng hồ này có thể sử dụng từ nơi làm việc đến nơi vui chơi trong khi giữ cho bạn phong cách.<p> <p>Kiểu dáng mạnh mẽ và tiện ích với các tính năng xem thời gian, đồng hồ thép không gỉ Casio Edifice dành cho nam giới (Model: EFA120D-1AV). Đồng hồ Analog / kỹ thuật số tròn này có khung bằng thép không gỉ với mặt số Analog tiêu chuẩn có vạch chỉ giờ màu trắng và kim chỉ thiết kế kiểu skeleton hình bầu dục mỏng. Đồng hồ cũng có các cửa sổ kỹ thuật số để hiển thị ngày hiện tại cũng như đồng hồ bấm giờ, có thể đo xuống tới 1/100 giây. Các tính năng khác của đồng hồ bấm giờ bao gồm bộ nhớ 50, chế độ đồng hồ bấm giờ với thời gian lặp vòng và tổng thời gian trôi qua, chế độ kép với hai thời gian vòng độc lập và thời lượng 100 giờ. Đồng hồ cũng bao gồm một nhiệt kế đo từng phút chẵn. Các tính năng xem giờ khác bao gồm: <p>* Giờ thế giới với 30 múi giờ (50 thành phố) với hiển thị mã thành phố và bật / tắt tiết kiệm ánh sáng ban ngày <p>* Báo thức hàng ngày <p>* Đồng hồ đếm ngược với phạm vi 100 giờ <p>* Lịch tự động (được lập trình trước cho đến năm 2099) <p>* Các định dạng 12/24 giờ<p>* Đồng hồ này cũng có vòng đeo tay bằng thép không gỉ thời trang, độ chính xác ± 30 giây mỗi tháng, đèn nền Afterglow và khả năng chống nước đến 100 mét (330 feet) - giúp bảo vệ khỏi các vụ va chạm vô tình cũng như thích hợp để bơi lội, lặn với ống thở và lặn giải trí trong thời gian ngắn.<p>  <p>- Với sự ra mắt của chiếc đồng hồ đầu tiên vào tháng 11 năm 1974, Casio bước vào thị trường đồng hồ đeo tay vào thời điểm ngành công nghiệp đồng hồ vừa phát hiện ra công nghệ kỹ thuật số. Là một công ty công nghệ điện tử tiên tiến chuyên phát triển máy tính bỏ túi, Casio bước vào lĩnh vực này tự tin rằng mình có thể phát triển những chiếc đồng hồ sẽ dẫn đầu thị trường.<p>- Ngày nay, Casio đang tập trung nỗ lực vào đồng hồ điều khiển bằng năng lượng mặt trời: Pin năng lượng mặt trời được tích hợp giúp loại bỏ việc thay pin phiền phức, thời gian tự động có nghĩa là người dùng không bao giờ phải đặt lại thời gian. Mới đây, Casio đã ra mắt một loạt đồng hồ Bluetooth đồng bộ hóa với điện thoại di động của người dùng để tự động cập nhật thời gian. Casio luôn luôn đi trước thời đại. <p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>',20, 'null', 'null','Việt Nam', 'Việt Nam', 'ChinSu', 21/01/2030  )
insert into Products values('40327711','SPL01','CT16','RT01', 'Đồng Hồ Quân Đội Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas - Màu Xanh Dương ','https://salt.tikicdn.com/cache/280x280/ts/product/c8/2e/a2/2db28bb5f82dabe8edb269e1143d3e3f.jpg', 1237700,'<div id="prodDetails">
<p><span id="bdisplayitem"><strong>Đồng Hồ Quân Đội Seiko 5 SNK807</strong> của hãng đồng hồ Seiko danh tiếng từ Nhật Bản, </span><span id="bdisplayitem">với công nghệ làm đồng hồ lâu đời, luôn đem đến cho người dùng những chiếc đồng hồ chất lượng, với các thiết kế đa dạng</span> </p>
<p>Lấy ý tưởng từ những người lính “thủy quân lục chiến”, Seiko đã tạo ra một trong những dòng sản phẩm độc đáo, và lạ mắt đó chính là Seiko 5 quân đội, một trong số đó là mẫu <strong>Seiko 5 SNK807.</strong> <span id="bdisplayitem"><strong>Đồng Hồ Quân Đội Seiko 5 SNK807 đ</strong></span>ược ra đời từ những năm đầu thập niên 60 của thế kỉ trước, nhằm phục vụ cho nhu cầu của những thanh niên Nhật Bản với đặc điểm nổi bật là sự bền bỉ, tính tiện dụng và sự trẻ trung.</p>
<p> </p>
<p><img id="https://salt.tikicdn.com/ts/tmp/22/ed/5c/214545c14a1404d23597c6cabc2f6b34.jpg" style="display: block; margin-left: auto; margin-right: auto;" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/22/ed/5c/214545c14a1404d23597c6cabc2f6b34.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="524" height="339" /></p>
<p dir="ltr"><strong>Đặc điểm của dòng Seiko 5:</strong></p>
<ul>
<li dir="ltr">Thứ nhất: Là chiếc đồng hồ cơ lên dây cót tự động.</li>
<li dir="ltr">Thứ hai: Độ chống nước tốt.</li>
<li dir="ltr">Thứ ba: Chống shock tốt.</li>
<li dir="ltr">Thứ tư: Núm điều chỉnh đặt ở vị trí 4h giúp hỗ trợ lên dây cót tốt hơn.</li>
<li dir="ltr">Thứ năm: Đồng hồ được trang bị lịch thứ, ngày tiện dụng.</li>
</ul>
<p style="text-align: center;"><span lang="vi"><img id="https://salt.tikicdn.com/ts/tmp/76/46/76/d76cf9134f5805fca8053e42067a5e27.jpg" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/76/46/76/d76cf9134f5805fca8053e42067a5e27.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="582" height="459" /></span></p>
<p><strong>Về chất liệu</strong>, <strong>Seiko 5 SNK807 </strong>sử dụng mặt kính cứng Hardlex cho khả năng chống xước, chống va đập tốt. Được phát minh bởi các nhà khoa học hàng đầu của Seiko, Hardlex Crystal sở hữu độ cứng hơn Mineral Crystal (kính cứng thường). Nên kính có khả năng chống trầy xước, va đập tốt hơn hẳn.</p>
<p>Phần vỏ được làm từ thép 316L không gỉ quen thuộc được đánh mờ tạo cảm giác ăn khớp kết hợp cùng dây vải nato cá tính và bụi bặm, chống nước, chống hôi, bền bỉ trong mọi điều kiện môi trường.</p>
<p><img id="https://salt.tikicdn.com/ts/tmp/6e/ce/c6/dfbd6f6bd8ee6ed994e28122d40df27b.jpg" style="display: block; margin-left: auto; margin-right: auto;" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/6e/ce/c6/dfbd6f6bd8ee6ed994e28122d40df27b.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="573" height="417" /></p>
<p style="text-align: center;"> </p>
<h4>Cơ chế hoạt động &amp; Chất lượng </h4>
<p><strong>Đồng hồ Seiko SNK807 </strong>sử dụng cơ chế hoạt động 7S26 bản quyền của hãng Seiko. Đây là loại cơ chế automatic non-hacking với mức dự trữ năng lượng lên tới 40 giờ. Cơ chế này có độ sai số trong tầm -20 đến +40 giây mỗi ngày. 7S26 là cơ chế hoạt động rất đáng tin cậy, được sử dụng trong hàng triệu chiếc đồng hồ hiện nay.</p>
<p><img id="https://salt.tikicdn.com/ts/tmp/2c/6a/b1/182b1211d5b9edf01a327b3fbbaafcda.jpg" style="display: block; margin-left: auto; margin-right: auto;" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/2c/6a/b1/182b1211d5b9edf01a327b3fbbaafcda.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="590" height="331" /></p>
<p style="text-align: center;">Về thiết kế, với đường kính mặt đồng hồ vào tầm 37mm, <strong>Đồng hồ Seiko 5 SNK807</strong> phù hợp với người có cổ tay nhỏ.</p>
<p style="text-align: center;"><span lang="vi"><img id="https://salt.tikicdn.com/ts/tmp/1c/37/2f/f029d8cae3aed2d8eb8e125e0ca6ac10.jpg" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/1c/37/2f/f029d8cae3aed2d8eb8e125e0ca6ac10.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="582" height="366" /></span></p>
<p style="text-align: center;"><span lang="vi"><img id="https://salt.tikicdn.com/ts/tmp/c2/85/f6/edfbc72ce831e2c5cd2f771276de9180.jpg" title="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" src="https://salt.tikicdn.com/ts/tmp/c2/85/f6/edfbc72ce831e2c5cd2f771276de9180.jpg" alt="Đồng Hồ Tự Động Seiko 5 SNK807 Bằng Thép Không Gỉ Kèm Dây Canvas" width="573" height="575" /></span></p>
<p style="text-align: left;"><span lang="vi">Model năm: 2017<br />Hình dạng sản phẩm: Tròn<br />Màn hình hiển thị: Analog<br />Chất liệu vỏ: Thép không gỉ<br />Đường kính vỏ: 37 mm<br />Chất liệu dây: Vải<br />Chiều dài dây: 10.25 inch<br />Độ rộng dây: 18 mm<br />Màu sắc dây: xanh<br />Màn hình số màu: Xanh dương<br />Chất liệu bezel: Thép không gỉ<br />Chịu nước ở độ sâu: 99ft<br />Tên thương hiệu: SEIKO<br />Số model: SNK807<br />Mã sản phẩm: SNK807<br />Móc khóa: Khóa<br />Độ dày vỏ: 11 mm<br />Tính năng đặc biệt: Sáng<br />Chất liệu màn hình số: Hardlex<br />Chức năng bezel: Văn phòng phẩm<br />Lịch: Thứ và ngày<br />Bộ máy: Tự động Thụy Sĩ<br />Trọng lượng sản phẩm: 0.26 gram</span></p>
<p>Thông tin bổ sung: Thích hợp để lặn trong thời gian ngắn, cũng như bơi, nhưng không lặn lâu.</p>
</div>
