insert into Products values('40322293','SPL01','CT16','RT01', 'Đồng Hồ Seiko SNE102 Dùng Năng Lượng Mặt Trời Bằng Thép Không Gỉ Với Dây Da Nâu','https://salt.tikicdn.com/cache/280x280/ts/product/49/65/f4/8da44ffeb96f341f88ac1d0ec6249b14.jpg', 1237700,'<p> Model năm: 2016<p>Hình dạng sản phẩm: Tròn<p>Màn hình hiển thị: Analog<p>Chất liệu vỏ: Thép không gỉ<p>Đường kính vỏ: 39 mm<p>Chất liệu dây: Da<p>Độ dài dây: Tiêu chuẩn nam<p>Độ rộng dây: 20 mm<p>Màu sắc dây: Nâu<p>Màu sắc màn hình số: Xanh dương<p>Chất liệu bezel: Thép không gỉ<p>Chịu nước ở độ sâu: 330 feet<p>Tên thương hiệu: SEIKO<p>Số model: SNE102<p>Mã sản phẩm: SNE102<p>Móc khóa: Khóa<p>Độ dày vỏ: 10 mm<p>Tính năng đặc biệt: Dạ quang<p>Chất liệu màn hình số: Hardlex<p>Chức năng bezel: Văn phòng phẩm<p>Lịch: Thứ và ngày<p>Bộ máy: Thạch anh Nhật Bản<p>Trọng lượng sản phẩm: 7.2 Ounces<p><p>- Từ khởi đầu khiêm tốn, tầm nhìn vĩ đại của Kintaro Hattori đã đưa Seiko trở thành một trong những thương hiệu đồng hồ Nhật Bản nổi tiếng nhất hiện nay, trên toàn thế giới. Một niềm đam mê cháy bỏng in sâu vào DNA của doanh nghiệp chúng tôi được truyền từ thế hệ này sang thế hệ khác. Seiko, trong 125 năm cam kết mang lại những chiếc đồng hồ vừa mang tính nghệ thuật và vừa mang lại giá trị khoa học thời gian.<p>- Một nền văn hóa đổi mới kết nối giữa cửa hàng đồng hồ cổ điển Tokyo ở thế kỷ 19 với những tiến bộ vượt bậc của thế kỷ 20 và một "cuộc cách mạng yên tĩnh" ở thế kỷ 21. Tiếp tục được thúc đẩy bởi sự cống hiến và niềm đam mê, đã thiết lập vô số công nghệ đầu tiên trên thế giới. Thay đổi các nguyên tắc định lượng thời gian.<p>- Đồng hồ đeo tay thạch anh đầu tiên - Cuộc cách mạng đã thay đổi lịch sử của thời gian.<p>- Kinetic đầu tiên - đánh dấu một kỷ nguyên mới trong công nghệ đồng hồ thạch anh.<p>- Năm 1969, Seiko Astron, chiếc đồng hồ đeo tay thạch anh đầu tiên - đã được giới thiệu.<p>- Ngay lập tức, Seiko cải thiện đồng hồ đeo tay theo cấp số nhân  - Và công nghệ Seiko đã thiết lập theo tiêu chuẩn thời gian của Olympic.<p>- 1984, lần đầu tiên được tổ chức - Công nghệ Kinetic — Đồng hồ có trọng lượng dao động, khi người đeo đồng hồ di chuyển năng lượng họ tạo ra sẽ được chuyển hóa thành điện năng.<p>- Kinetic Chronograph - Thế hệ tiếp theo của đồng hồ mang hiệu suất cao.<p>- Kinetic Auto Relay - Tự động đặt lại đúng thời gian.<p>- Kinetic Perpetual - Kết hợp hoàn hảo công nghệ của lịch vạn niên với Kinetic Auto Relay.<p>- Và bây giờ Kinetic Direct Drive - Chỉ cần di chuyển và đồng hồ được cung cấp năng lượng tự động. Hoặc dùng tay xoay đồng hồ và xem năng lượng bạn vừa tạo ra trong thời gian thực.<p>- Trong vương quốc của những chiếc đồng hồ tuyệt vời, thời gian được đo bằng sự đổi mới của Seiko - Một di sản của sự cống hiến cho nghệ thuật và khoa học của thời gian.<p>  <p>Di sản của chúng tôi<p>- Câu chuyện về Seiko bắt đầu vào năm 1881, khi một doanh nhân 22 tuổi, Kintaro Hattori, mở một cửa hàng bán và sửa chữa đồng hồ và đồng hồ ở trung tâm Tokyo.<p>- Ngày nay, sau hơn 130 năm đổi mới, công ty Kintaro Hattori vẫn tận tâm vì sự hoàn hảo mà người sáng lập luôn nỗ lực để đạt được. <p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>',20, 'null', 'null','Việt Nam', 'Việt Nam', 'ChinSu', 21/01/2030  )
