    </div> 
    <h4 class="a-spacing-mini"> Latin For Invincible </h4> 
    <p class="a-size-small"> The INVICTA Watch Group is led by innovation and nurtured with the consistency of quality and brand personality. Founded more than a century ago with the belief that supremely crafted timepieces can be offered for modest sums, INVICTA holds true to this objective today and continues its brazen journey in the future. </p> 
