<p>Made in USA or Imported</p>
<p>Round watch featuring corrugated unidirectional bezel, luminous hands/markers, and magnified date window at 3 o'clock</p>
<p>40 mm, Length: 210mm, 23k gold-plated stainless steel case with mineral dial window</p>
<p>Push the crown back to position 1 .To start an automatic, you can hand wind it by rotating the crown clockwise a number of turns while in its normal operating position (screw down crowns will need to be unscrewed first), or by swinging it side to side for 30 seconds. We recommend housing an automatic in a watch winder box</p>
<p>Gold &amp; Stainless steel tone bracelet with foldover clasp with safety closure</p>
<p>Water resistant to 200 m (660 ft): In general, suitable for professional marine activity and serious surface water sports, but not scuba diving.</p>
<p></p>
<p>Invicta, Pro Diver, Men's Watch, Stainless Steel and Yellow Gold Plated Case, Stainless Steel and Yellow Gold Plated Bracelet, Mechanical Automatic (Self-Winding), 8928C</p>
<p>Classic styling and high performance add up to an outstanding sport watch for your land or sea adventures. This two-tone automatic watch, from Invicta's Pro Diver series, places a large round stainless steel case on a robust steel bracelet with gold-plated center links. The electric blue dial is designed for quick and easy read-off, even in low light conditions. It offers three-hand function with luminous hands and markers and a magnified date display at the three o'clock position. The detailed hands, in Mercedes, sword, and breguet-style logo shapes, add a note of distinction. The dial is capped with a resilient mineral crystal and framed by a blue unidirectional rotating steel bezel with goldtone markings and coin edge detailing. This watch is driven by a Japanese automatic movement, which is visible through the see-through skeleton case back. It is rated water resistant to a full 200 meters.</p>
<p>Plunge into any horizon using the steadfast guidance of the Invicta Pro Diver. Stylishly classic, internal workings are forged with variations of either Swiss chronograph or 21-jewel automatic movements and willingly navigate in depths up to 300 meters. Built with confident prowess, the fortitude with which these timepieces function makes the Pro Diver the quintessential in performance.</p>
<p>Automatic watches are made up of about 130 or more parts that work together to tell time. Automatic movements mark the passage of time by a series of gear mechanisms, and are wound by the movement of your wrist as you wear it. The gear train then transmits the power to the escapement, which distributes the impulses, turning the balance wheel. The balance wheel is the time regulating organ of a mechanical watch, which vibrates on a spiral hairspring. Lengthening or shortening the balance spring makes the balance wheel go faster or slower to advance or retard the watch. The travel of the balance wheel from one extreme to the other and back again is called oscillation. Lastly, automatic movements come in different types, including movements that are Swiss-made, Japanese-made, and more.</p>
<p>Also referred to as self-winding, watches with automatic movements utilize kinetic energy, the swinging of your arm, to provide energy to an oscillating rotor to keep the watch ticking. They're considered more satisfying to watch collectors (horologists) because of the engineering artistry that goes into the hundreds of parts that make up the movement. If you do not wear an automatic watch consistently (for about 8 to 12 hours a day), you can keep the watch powered with a watch winder (a great gift for collectors).</p>
<p>With its most inspired creations yet, Invicta demonstrates its technical and design prowess, offering timepieces of style for extreme value.</p>
<p>"We have long held firm to the belief that supremely crafted timepieces can be offered for extremely modest sums. It is the founding principle of our flagship and the radical notion that still drives us today. By being true to our convictions, we will continue to turn the balance of power, and deliver true Swiss luxury to anyone who desires it. Let all those who possess our timepieces and pass through our doors witness the quality, value and care in every piece we create, and the spirit of never-ending possibilities in everything we do."</p>
<p>These are the words that greet visitors and motivate team members inside the Invicta Watch Group's new worldwide headquarters. Emblazoned in stainless steel, it has been the Invicta message since Day One.</p>
<p>With each new timepiece, the company sends up a flare for those looking to be defined not by how much they spend, but how wisely they spend. With its strong collections, the gutsy Swiss brand is guaranteed to keep attracting followers.</p>
<p>It takes years of training and a great deal of pride to achieve glorious Swiss timepieces by hand. But it takes guts and the courage of your convictions to make those timepieces affordable for everyone who appreciates them.</p>
<p>At our Swiss workshops, we mix time-honored traditions with a little bit of horse sense every single day to produce the greatest values in the watch-making world.</p>
<p></p>
<p> </p>
