<p id="prodDetails"> </p>
<p><img class="a-spacing-mini" style="display: block; margin-left: auto; margin-right: auto;" src="https://salt.tikicdn.com/ts/product/6e/27/da/310248239d8b519cbf44309d07229730.png" alt="" width="750" height="231" /></p>
<h5><strong>Giới thiệu về đồng hồ Orient </strong></h5>
<ul>
<li>Đã sản xuất đồng hồ hơn 65 năm.</li>
<li>Tất cả các chuyển động và chi tiết của đồng hồ được sáng tạo và sản xuất tại Nhật Bản.</li>
<li>Bộ máy của đồng hồ được sản xuất bằng chất lượng cao nhất, thể hiện niềm đam mê thật sự của Orient về chế tạo đồng hồ.</li>
</ul>
<h5><strong>The Sun &amp; Moon V</strong><strong>ersion II</strong></h5>
<ul>
<li>Dòng đồng hồ <strong>Orient Sun And Moon</strong> thuộc bộ sưu tập <strong>Classic – Cổ điển</strong>, tạo ra bằng tất cả sự tôn kính những truyền thống xưa cũ bởi hãng Orient có lịch sử từ năm 1950 của Nhật Bản.</li>
<li>Những chiếc đồng hồ <strong>Orient Sun And Moon</strong> đầu tiên được giới thiệu vào năm 2014. Năm 2015, đồng hồ <strong>Orient Sun And Moon Version 2</strong> (Gen 2) ra đời, thay đổi đáng kể thiết kế mặt số so với bản gốc: dùng chữ số La Mã tinh tế, họa tiết guilloché sang trọng, đĩa Mặt Trời và Mặt Trăng có màu sắc sống động hơn.</li>
</ul>
<p><img id="https://salt.tikicdn.com/ts/tmp/2b/58/17/efa0a80666fbd6edb96ce973c04c6ab1.jpeg" style="display: block; margin-left: auto; margin-right: auto;" title="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" src="https://salt.tikicdn.com/ts/tmp/2b/58/17/efa0a80666fbd6edb96ce973c04c6ab1.jpeg" alt="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" width="609" height="341" /></p>
<ul>
<li>
<p><strong>Orient Sun And Moon Version 2</strong> là thiết kế gây ảnh hưởng sâu sắc nhất đến các phiên bản sau này. Đây cũng là bản Orient Sun And Moon ăn khách nhất tại Việt Nam và toàn thế giới năm 2017.</p>
</li>
</ul>
<p><img id="https://salt.tikicdn.com/ts/tmp/30/21/54/4649e538e2523644ba465ee37b73d083.jpg" style="display: block; margin-left: auto; margin-right: auto;" title="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" src="https://salt.tikicdn.com/ts/tmp/30/21/54/4649e538e2523644ba465ee37b73d083.jpg" alt="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" width="618" height="355" /></p>
<h5><strong>CÁCH HOẠT ĐỘNG CỦA CHỨC NĂNG SUN AND MOON</strong></h5>
<p><strong><img id="https://salt.tikicdn.com/ts/tmp/91/3f/11/5d842d009e0a750283a571a1293e6435.jpeg" style="display: block; margin-left: auto; margin-right: auto;" title="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" src="https://salt.tikicdn.com/ts/tmp/91/3f/11/5d842d009e0a750283a571a1293e6435.jpeg" alt="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" width="623" height="349" /></strong></p>
<ul>
<li>Sun and Moon còn gọi là Ngày và Đêm (Day and Night), chúng cho biết thời gian hiện tại của đồng hồ là sáng hay chiều, tương đương chức năng Đồng Hồ 24 Giờ. Chức năng được trình bày dưới dạng một đĩa tròn, một nửa được in hình Mặt Trời và bầu trời xanh, một nửa in hình Mặt Trăng, sao và bầu trời đêm.<br /><br /><img id="https://salt.tikicdn.com/ts/tmp/5c/d4/2b/e2b190663231fbd1b1194cd11615414e.jpeg" style="display: block; margin-left: auto; margin-right: auto;" title="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" src="https://salt.tikicdn.com/ts/tmp/5c/d4/2b/e2b190663231fbd1b1194cd11615414e.jpeg" alt="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" width="620" height="347" /></li>
</ul>
<p> </p>
<ul>
<li>
<p style="text-align: center;">Đĩa tròn in hình Mặt Trời Mặt Trăng sẽ được đặt bên dưới ô cửa sổ có hình đám mây, xoay liên tục một cách chậm rãi, một vòng xoay sẽ kéo dài đúng 24 tiếng. Hằng ngày, cứ 6 giờ sáng thì mặt trời sẽ dần xuất hiện qua ô cửa sổ, đến 6 giờ tối thì mặt trời biến mất hoàn toàn và mặt trăng dần xuất hiện.<br /><br /><img id="https://salt.tikicdn.com/ts/tmp/d8/76/6b/b5ef25eaec9568971274331b42f9e623.jpeg" title="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" src="https://salt.tikicdn.com/ts/tmp/d8/76/6b/b5ef25eaec9568971274331b42f9e623.jpeg" alt="Orient Men's 'Sun and Moon Version 2' Japanese Automatic Watch" width="627" height="351" /></p>
</li>
<li>
<p>Chức năng Sun and Moon sẽ được đồng bộ với Giờ Phút (không chỉnh riêng được). Ngoài ra, ta có thể theo dõi Sun and Moon để đảm bảo việc thiết đặt Lịch nhảy đúng buổi-đúng ngày.</p>
</li>
<li>Nhà sản xuất Orient cảnh báo khách hàng <strong><span style="text-decoration: underline;">không được chỉnh giờ</span></strong> trong khung giờ từ <strong>9.00 PM</strong> – <strong>2.00 AM</strong> của đồng hồ. Điều này sẽ hạn chế việc nhảy sai lịch và giảm nguy cơ hỏng bộ máy về sau.</li>
</ul>
<h5><strong>Các đặc điểm nổi bật của đồng hồ Orient Sun and Moon version 2 </strong></h5>
<ul>
<li>Mặt đồng hồ được xử lý bằng họa tiết <em><strong>Guilloché</strong></em> - họa tiết chỉ được dùng cho những dòng đồng hồ đeo tay cao cấp nhất hiện nay.</li>
<li>Loại họa tiết <em><strong>Guilloché</strong></em> được sử dụng là <strong>Grand Tapisserie</strong> với hàng ngàn ô vuông nổi, chìm cách đều nhau, tạo nên hiệu ứng vô cùng bắt mắt ngay cả khi nhìn xa. Điều này cũng góp phần tăng thêm khả năng hiển thị cho đồng hồ và tốt cho thị lực.</li>
<li>Đồng hồ cơ theo tiêu chuẩn Japan Movt, thời gian trữ cót đên 40 giờ, mức độ sai số chỉ rơi vào mức +25 giây ~ -15 giây mỗi ngày. Và việc lên cót thường xuyên sẽ giúp ổn định các thông số này theo thời gian.</li>
<li>Dây đồng hồ được làm bằng chất liệu da chính hãng kết hợp thêm vân cá sấu tự nhiên.</li>
<li><strong>Chống nước 5ATM</strong>. Điều này đảm bảo người dùng thoải mái đi mưa cũng như rửa tay, tắm bồn trong thời gian lâu mà không sợ ảnh hưởng đến thân máy và tuổi thọ chung của đồng hồ.</li>
<li>Mặt kính đồng hồ <strong>Orient Sun And Moon Version 2</strong> được thiết kế theo dạng cong. Một phần là giúp đồng hồ đạt tối đa mức độ chịu lực, phần còn lại sẽ tăng tính thẩm mỹ của đồng hồ khi nằm nghiêng. Ngoài ra, nhờ chất liệu kính Sapphire cũng giúp <strong>tăng gấp 3 khả năng chịu lực, chống trầy xước</strong> hơn các loại kính thông thường.</li>
</ul>
