insert into Products values('40319266','SPL01','CT16','RT01', 'Đồng Hồ Casio SGW300HB-3AVCF Đa Năng Với Dây Nylon Xanh Lá','https://salt.tikicdn.com/cache/280x280/ts/product/ce/e1/87/45e37ce24a9a9804064e640b1eab74d2.jpg', 1237700,'<p> Model năm: 2017<p>Hình dạng sản phẩm: Tròn<p>Màn hình hiển thị: Kỹ thuật số<p>Chất liệu vỏ: Nhựa<p>Đường kính vỏ: 50 mm<p>Chất liệu dây: Nylon<p>Độ dài dây: Mens-Standard<p>Độ rộng dây: 24 mm<p>Màu sắc dây: Xanh lá<p>Màu sắc màn hình số: Xám<p>Chất liệu khung bezel: Nhựa<p>Chịu nước ở độ sâu: 330 feet<p>Tên thương hiệu: Casio<p>Số model: EAW-SGW-300HB-3AV<p>Mã sản phẩm: SGW300HB-3AVCF<p>Móc khóa: Khóa<p>Độ dày vỏ: 14 mm<p>Các tính năng đặc biệt: Tính năng báo thức, tính năng đo độ cao, Đồng hồ bấm giờ, Chống nước, Giờ thế giới<p>Trọng lượng sản phẩm: 8.01 Ounces<p><p>Chiếc đồng hồ này bắt đầu với vỏ nhựa 42mm với khung và bốn nút ấn để điều khiển vô số chức năng, cũng được trang trí trên vỏ. Thêm vào đó là màn hình kỹ thuật số. Các chức năng bao gồm: Đo độ cao, áp kế, nhiệt kế, giờ thế giới, năm báo thức, đèn LED, đồng hồ bấm giờ, đồng hồ đếm ngược và cuối cùng là định dạng 12/24 giờ. Dây đeo bằng nylon màu xanh lá cây của đồng hồ giúp cho bạn thoải mái khi đeo. Đồng hồ vẫn an toàn nhờ một khóa móc.<p><p>- Với sự ra mắt của chiếc đồng hồ đầu tiên vào tháng 11 năm 1974, Casio bước vào thị trường đồng hồ đeo tay vào thời điểm ngành công nghiệp đồng hồ vừa phát hiện ra công nghệ kỹ thuật số. Là một công ty công nghệ điện tử tiên tiến chuyên phát triển máy tính bỏ túi, Casio bước vào lĩnh vực này tự tin rằng mình có thể phát triển những chiếc đồng hồ sẽ dẫn đầu thị trường.<p>- Ngày nay, Casio đang tập trung nỗ lực vào đồng hồ điều khiển bằng năng lượng mặt trời: Pin năng lượng mặt trời được tích hợp giúp loại bỏ việc thay pin phiền phức, thời gian tự động có nghĩa là người dùng không bao giờ phải đặt lại thời gian. Mới đây, Casio đã ra mắt một loạt đồng hồ Bluetooth đồng bộ hóa với điện thoại di động của người dùng để tự động cập nhật thời gian. Casio luôn luôn đi trước thời đại. <p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>',20, 'null', 'null','Việt Nam', 'Việt Nam', 'ChinSu', 21/01/2030  )
