insert into Products values('40321064','SPL01','CT16','RT01', 'Đồng Hồ Nam Timex Intelligent Quartz T2N721 Kèm La Bàn Với Dây Nâu','https://salt.tikicdn.com/cache/280x280/ts/product/61/d4/57/31c7ff0aa68b8703913e6fef6cb1a2d8.jpg', 1237700,'<p><em><strong>Đồng Hồ Quartz Thông Minh Có La Bàn Và Chức Năng Đo Thủy Triều</strong></em></p>
<p>Với nhiều chức năng bao gồm máy theo dõi thủy triều, cảm biến nhiệt độ và la bàn điện tử được điều khiển bởi một kim thứ tư chuyên dụng, Đồng Hồ Timex là phụ kiện tối ưu cho giới chuyên môn am hiểu công nghệ với tình yêu phiêu lưu.</p>
<p>Đồng hồ tròn bằng thép không gỉ có viền hai chiều và la bàn kỹ thuật số; Chuyển động thạch anh với màn hình Analog; Màn hình số bằng tinh thể khoáng bảo vệ; Có đèn nền, nhiệt kế kỹ thuật số để đo nhiệt độ không khí và nước, dây đeo bằng da, theo dõi thủy triều và khóa đóng; chống nước ở độ sâu 100m (330ft)</p>
<h5><strong>Đèn nền INDIGLO</strong></h5>
<p>Nhấn nút ấn bên cạnh hoặc nút để kích hoạt. Công nghệ phát sáng được sử dụng bởi chức năng đèn nền INDIGLO chiếu sáng toàn bộ mặt đồng hồ vào ban đêm hoặc trong điều kiện ánh sáng yếu.</p>
