<p>The perfect gift for any Nurse. Give that special Nurse a gift they will show friends with this beautiful Whimsical Watch. Your Nurse themed watch will coordinate with your favorite Whimsical Earrings, Bracelet, Necklace or Charms. It fastens with a buckle for easy on and off. All large Whimsical Watches are 10" in length, 1.5" in diameter, come with quartz movement, lithium ion battery, scratch resistant glass, water resistant case, leather strap, one year manufacturers warranty all in a beautiful gift box. Whimsical Watches are high quality, fashion statements that are bound to be the topic of every conversation and favorite gift for every occasion!</p>
