    <p class="a-spacing-base"> For over 40 years, Citizen's proprietary Eco-Drive technology has served as the prime example of how the brand is dedicated to the world and making its environment a better place. A simple yet revolutionary concept, Eco-Drive harnesses the power of light from any natural or artificial light source and converts it into energy, eliminating the need for any battery replacement. Using renewable energy to keep Citizen Eco-Drive watches running forever. </p> 
