      <p class="a-text-center"> <img alt="fossil" src="https://salt.tikicdn.com/ts/product/ec/45/b5/794155f0c6a370229854e036c2ee06bf.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/ec/45/b5/794155f0c6a370229854e036c2ee06bf.jpg"></p>
