      <br>
      <h4 class="a-spacing-mini"> QUALITY MATERIALS </h4> 
      <p class="a-spacing-base"> </p>
      <ul class="a-unordered-list a-vertical">
       <li><span class="a-list-item">Our high-quality leather is known for its softness and ability to look good over time.</span></li>
       <li><span class="a-list-item">Stainless steel watch bracelets are extremely durable and can last the lifetime of a watch if properly maintained. We offer free watch adjustments in our Fossil Retail and Outlet Stores.</span></li>
       <li><span class="a-list-item">Silicone watch straps are waterproof and very comfortable to wear.</span></li>
      </ul>
      <p class="a-text-center"> <img alt="fossil watch" src="https://salt.tikicdn.com/ts/product/cc/11/d4/8d36000c0de3b92e42c2f8f939edd293.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/cc/11/d4/8d36000c0de3b92e42c2f8f939edd293.jpg"></p>
      <noscript>
       <img alt="fossil watch" src="https://salt.tikicdn.com/ts/product/cc/11/d4/8d36000c0de3b92e42c2f8f939edd293.jpg">
      </noscript> 
      <br>
      <h4 class="a-spacing-mini"> INTERCHANGEABLE WATCH BANDS </h4> 
      <p class="a-spacing-base"> There’s no better way to keep your favorite looks fresh than with our swappable, versatile watch straps. Our quick release pins allow you to change up your look as often as you like while maintaining your signature style. </p> 
      <p class="a-text-center"> <img alt="fossil watch" src="https://salt.tikicdn.com/ts/product/01/e8/a3/80b0c40a4b4a7a97be20b2886cf8d3dd.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/01/e8/a3/80b0c40a4b4a7a97be20b2886cf8d3dd.jpg"></p>
      <noscript>
       <img alt="fossil watch" src="https://salt.tikicdn.com/ts/product/01/e8/a3/80b0c40a4b4a7a97be20b2886cf8d3dd.jpg">
      </noscript> 
      <br>
      <h4 class="a-spacing-mini"> WATER RESISTANT </h4> 
      <p class="a-spacing-base"> </p>
      <ul class="a-unordered-list a-vertical">
       <li><span class="a-list-item">3ATM: withstands splashes or brief immersion in water but not swimming or bathing</span></li>
       <li><span class="a-list-item">5 ATM: wearable around household sinks or while swimming in shallow water</span></li>
       <li><span class="a-list-item">10 ATM: suitable for bathing, swimming or snorkeling, but not scuba diving</span></li>
