  <p>Shock resistant, mud resistant, and low temperature resistant, the rugged and durable Casio Men's G-Shock Military Concept Watch stands up to the toughest environments. A stealth, black matte finish gives this multi-function timepiece a modern look, and the robust features include a ridged, black resin band that fastens with a buckle clasp. Equipped with options for 29 time zones, flash alert, stopwatch, countdown timer, five alarms, 12- and 24-hour formats, this ultra-reliable timepiece also uses a handy EL backlight for day or night viewing. The black dial works with an innovative light-on-dark display and features a split screen with the time and the day, date, and month. Water resistant to 660 feet (200 meters), this powerful watch will stand up to extreme use.</p>
