      <p class="a-text-center"> <img alt="fossil" src="https://salt.tikicdn.com/ts/product/ec/45/b5/e8d8cf885e4300cb05c779701b97a4b6.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/ec/45/b5/e8d8cf885e4300cb05c779701b97a4b6.jpg"></p>
      <noscript>
       <img alt="fossil" src="https://salt.tikicdn.com/ts/product/ec/45/b5/e8d8cf885e4300cb05c779701b97a4b6.jpg">
      </noscript> 
      <br>
      <h4 class="a-spacing-mini"> ABOUT US </h4> 
      <p class="a-spacing-base"> Fossil has always been inspired by creativity and ingenuity. We've strived to bring new life into the industry by making quality, fashionable watches and accessories that are both fun and accessible. </p> 
      <p class="a-text-center"> <img alt="fossil" src="https://salt.tikicdn.com/ts/product/55/26/93/4945270d533e54839c042d680d355398.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/55/26/93/4945270d533e54839c042d680d355398.jpg"></p>
      <noscript>
       <img alt="fossil" src="https://salt.tikicdn.com/ts/product/55/26/93/4945270d533e54839c042d680d355398.jpg">
      </noscript> 
      <br>
      <h4 class="a-spacing-mini"> ABOUT THE MOVEMENT </h4> 
      <p class="a-spacing-base"> </p>
      <ul class="a-unordered-list a-vertical">
       <li><span class="a-list-item">Three-hand Quartz: This electronic watch movement features a quartz crystal that oscillates when a current is applied to it.</span></li>
       <li><span class="a-list-item">Multifunction: Quartz movement typically built into three separate sub-eyes for the day of the week, date of the month and 24-hour time. </span></li>
       <li><span class="a-list-item">Chronograph: A multifunction watch with stopwatch functionality.</span></li>
      </ul>
      <p class="a-text-center"> <img alt="fossil" src="https://salt.tikicdn.com/ts/product/73/61/9c/082ed0038c272e3861edc639f3845459.jpg" class="a-spacing-mini a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/73/61/9c/082ed0038c272e3861edc639f3845459.jpg"></p>
      <noscript>
       <img alt="fossil" src="https://salt.tikicdn.com/ts/product/73/61/9c/082ed0038c272e3861edc639f3845459.jpg">
      </noscript> 
      <br>
      <h4 class="a-spacing-mini"> GIFTABLE TINS </h4> 
      <p class="a-spacing-base"> Our watch tins are ready to gift or collect. We’ve spent decades perfecting our craft and creating watches that you’ll love to wear and collect. </p> 
     </div> 
    </div> 
   </div> 
   <div class="celwidget aplus-module module-9" cel_widget_id="aplus-m-module-9"> 
