       </div> 
       <div class="apm-wrap"> 
        <p class="a-spacing-base"> Plunge into any horizon using the steadfast guidance of the INVICTA Pro Diver. Stylishly classic, internal workings are forged with variations of bold movements. Built with confident prowess, the fortitude with which these timepieces function makes the Pro Diver the quintessential in performance. </p> 
