<p></p>
<p>Tissot, the 'Innovators by Tradition', has been pioneering craftsmanship and innovation since its foundation in 1853. The Tissot innovation leadership is enabled by the development of high-tech products, special materials, and advanced functionality. Since then, Tissot's timepieces have been chosen as official timekeepers for world championships in cycling, motorcycling, fencing and ice hockey. Also Tissot is currently the official watch and timekeeper of NASCAR. Stainless steel case, Stainless steel snap-down caseback, Black dial, Silvertone luminescent hands, Silvertone indices and Arabic numerals, Magnified date at the 3 o'clock position, Small seconds subdial at the 6 o'clock position, Chronograph minutes subdial at the 10 o'clock position and hours subdial at the 2 o'clock position, Tachymeter scale displayed around the flange, Sapphire crystal, Push/pull crown, Swiss quartz movement, Water resistant to 10 ATM/100 meters/330 feet, Black rubber strap, fold over clasp with double push button safety.</p>
<p>Tissot is no slouch on the world stage. Their timepieces have been chosen as official timekeepers for world championships in cycling, motorcycling, fencing and ice hockey. Also Tissot is currently the official watch and timekeeper of NASCAR. This watch is no exception. The Tissot Men's T-Race Black Chronograph Dial Watch begins with a 45mm stainless steel case, a black-toned bezel and prominent pushers with a protected crown on the right side of the case. These elements surround a bold black dial, which is protected by a scratch-resistant sapphire crystal and features silver-toned stick and Arabic hour markers and hands powered by precise Swiss quartz movement. The dial also features three chronograph sub-dials and a date display window at the 3 'o clock position. The watch's black rubber strap gives this exceptional watch a sporty feel as it reaches out to the push-button deployment clasp. Exhibit a world-class timepiece on your wrist with this amazing watch.</p>
