insert into Products values('33289971','SPL01','CT16','RT01', 'Túi Đeo Chống Nước Đa Năng Có Khe Cắm Sạc USB MARK RYDEN','https://salt.tikicdn.com/cache/280x280/ts/product/d6/ba/d2/471c4f7474a59c08c3a1c6e2a1dc9687.jpg', 1237700,'<p>Túi đeo vai đơn có sức chứa lớn hơn túi bình thường, chất liệu vải oxford rất tiện dụng và không thấm nước. Cốc hút bạch tuộc, băng cố định và thanh chống trượt điện thoại. Có 3 cách mang. Thuận tiện sạc ngoài USB.<br /><br /></p>
