insert into Products values('40317251','SPL01','CT16','RT01', 'Đồng Hồ Casio Classic MTP3050D-2AV Bằng Thép Không Gỉ Với Pin Sử Dụng 10 Năm','https://salt.tikicdn.com/cache/280x280/ts/product/46/7e/c5/a2653ff9609fc33af20db632596f2331.jpg', 1237700,'<p> Hình dạng sản phẩm: Tròn<p>Màn hình hiển thị: Analog<p>Chất liệu vỏ: Thép không gỉ<p>Đường kính vỏ: 39 mm<p>Chất liệu dây: Thép không gỉ<p>Độ dài dây: Nam<p>Độ rộng dây: 22 mm<p>Màu sắc dây: Bạc<p>Màu sắc màn hình số: Xanh dương<p>Chất liệu khung bezel: Tông màu bạc<p>Chịu nước ở độ sâu: 165 feet<p>Tên thương hiệu: Casio<p>Số kiểu: EAW-MTP-3050D-2AV<p>Mã sản phẩm: MTP3050D-2AV<p>Móc khóa: Khóa gấp với 2 nút bấm an toàn<p>Độ dày vỏ: 10 mm<p>Tính năng đặc biệt: Chống nước<p>Trọng lượng sản phẩm: 4.8 Ounces<p><p>Đồng hồ có tông màu bạc có mặt số sunray màu xanh dương với các vạch chỉ thời gian và màn hình chỉ ngày ở vị trí 3 giờ 39 phút bằng thép không gỉ với màn hình số khoáng; Màn hình Analog; Vòng đeo tay bằng thép không gỉ có khóa gập với nút bấm đôi an toàn; Chống nước 50m (165ft): Nhìn chung, thích hợp cho thời gian bơi lội giải trí ngắn, nhưng không lặn hoặc lặn với ống thở<p><p>Đồng hồ đeo tay Casio cổ điển này có kiểu dáng đẹp và thanh lịch thích hợp cho công sở, sau giờ làm việc và sử dụng hàng ngày. Thiết kế hợp lý kết hợp nhuần nhuyễn giữa dây thép không gỉ với khung thép không gỉ tròn và vạch chỉ giờ và kim chỉ thời gian màu bạc trên mặt số màu xanh. Ngày được hiển thị ở vị trí 3 giờ và vòng bên trong tinh tế của các chữ số Ả Rập giúp chuyển đổi 24 giờ dễ dàng. Dây đeo với một khóa gấp có nút nhấn đôi an toàn. Đồng hồ bộ máy thạch anh này đi kèm với tuổi thọ pin 10 năm, cung cấp khả năng chống nước lên đến 165 feet.<p><p>- Với sự ra mắt của chiếc đồng hồ đầu tiên vào tháng 11 năm 1974, Casio bước vào thị trường đồng hồ đeo tay vào thời điểm ngành công nghiệp đồng hồ vừa phát hiện ra công nghệ kỹ thuật số. Là một công ty công nghệ điện tử tiên tiến chuyên phát triển máy tính bỏ túi, Casio bước vào lĩnh vực này tự tin rằng mình có thể phát triển những chiếc đồng hồ sẽ dẫn đầu thị trường.<p>- Ngày nay, Casio đang tập trung nỗ lực vào đồng hồ điều khiển bằng năng lượng mặt trời: Pin năng lượng mặt trời được tích hợp giúp loại bỏ việc thay pin phiền phức, thời gian tự động có nghĩa là người dùng không bao giờ phải đặt lại thời gian. Mới đây, Casio đã ra mắt một loạt đồng hồ Bluetooth đồng bộ hóa với điện thoại di động của người dùng để tự động cập nhật thời gian. Casio luôn luôn đi trước thời đại.<p> <p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>',20, 'null', 'null','Việt Nam', 'Việt Nam', 'ChinSu', 21/01/2030  )
