       </noscript> 
      </div> 
      <h4 class="a-spacing-mini"> Latin For “Invincible” </h4> 
      <p class="a-size-small"> The Invicta Watch Group is led by innovation and nurtured with the consistency of quality and brand personality. Founded more than a century ago with the belief that supremely crafted timepieces can be offered for modest sums, Invicta holds true to this objective today and continues its brazen journey in the future </p> 
     </div> 
     <div class="a-section"> 
      <div class="a-section a-text-center"> 
       <img alt="a" src="https://salt.tikicdn.com/ts/product/a2/57/21/8a290bf242259c85dde7eea9fd2778bb.jpg" class="a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/a2/57/21/8a290bf242259c85dde7eea9fd2778bb.jpg">
       <noscript>
        <img alt="a" src="https://salt.tikicdn.com/ts/product/a2/57/21/8a290bf242259c85dde7eea9fd2778bb.jpg">
       </noscript> 
      </div> 
      <h4 class="a-spacing-mini"> Making Statements </h4> 
      <p class="a-size-small"> The expertise and execution in design as well as case construction is intrinsic to our inventive reputation and style. With this forward thinking energy, Invicta is fully equipped to suit and satisfy the most particular and diverse of tastes. The aim is to always achieve creative articulations in time from different points of view. </p> 
     </div> 
     <div class="a-section"> 
      <div class="a-section a-text-center"> 
       <img alt="a" src="https://salt.tikicdn.com/ts/product/37/99/4e/943a82f31dee45ce1cb90f08dc6285a2.jpg" class="a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/37/99/4e/943a82f31dee45ce1cb90f08dc6285a2.jpg">
       <noscript>
        <img alt="a" src="https://salt.tikicdn.com/ts/product/37/99/4e/943a82f31dee45ce1cb90f08dc6285a2.jpg">
       </noscript> 
      </div> 
      <h4 class="a-spacing-mini"> Setting A Precedent </h4> 
      <p class="a-size-small"> Taking the meticulous art of case construction to new levels, Invicta is now recognized as the masters of case complications. Because of the exceptional engineering found in each model, technical revelations deliver outstanding performance in every watch. The brand now grown to encompass over 30 diverse collections. </p> 
     </div> 
     <div class="a-section"> 
      <div class="a-section a-text-center"> 
       <img alt="a" src="https://salt.tikicdn.com/ts/product/a3/b7/9c/e881445da775b068af55628126c8726f.jpg" class="a-lazy-loaded" data-src="https://salt.tikicdn.com/ts/product/a3/b7/9c/e881445da775b068af55628126c8726f.jpg">
       <noscript>
        <img alt="a" src="https://salt.tikicdn.com/ts/product/a3/b7/9c/e881445da775b068af55628126c8726f.jpg">
       </noscript> 
      </div> 
      <h4 class="a-spacing-mini"> Innovation In Motion </h4> 
      <p class="a-size-small"> Utilizing high quality materials generally found only in high-priced brands, each timepiece is crafted and rigorously tested to ensure optimum standards. From skeletonized movements to a unique gold layering technique to exceptional construction, Invicta has become one of the most technically capable watch makers in the world. </p> 
     </div> 
    </div> 
