        <p class="a-spacing-base"> The dials are colored with a palette found in nature and accented with occasional pops of bright hues. Three sub-dials track minutes, seconds, and 1/20 of a second for up to 30 minutes. An easy to operate date window is located at 4 o’clock. </p> 
        <p class="a-spacing-base"> Each Expedition chronograph is equipped with Indiglo night-light providing easy readability in the dark. All styles are water-resistant up to 100 meters (330 feet) and the Sierra collection features shock resistance to I.S.O. standards. </p> 
