 <div class="celwidget aplus-module module-4" cel_widget_id="aplus-m-module-4"> 
  <div class="aplus-module-wrapper"> 
   <h3 class="a-spacing-medium"> INVICTA Watch Group </h3> 
   <div class="a-section"> 
    <div class="a-section a-text-center"> 
     <img alt="" src="https://salt.tikicdn.com/ts/product/e8/26/16/3efb5ec6ec1baae0defc08d83f43eb96.jpg">
    </div> 
    <h4 class="a-spacing-mini"> Latin For 'Invincible' </h4> 
    <p class="a-size-small"> The Invicta Watch Group is led by innovation and nurtured with the consistency of quality and brand personality. Founded more than a century ago with the belief that supremely crafted timepieces can be offered for modest sums, Invicta holds true to this objective today and continues its brazen journey in the future. </p> 
   </div> 
   <div class="a-section"> 
    <div class="a-section a-text-center"> 
     <img alt="" src="https://salt.tikicdn.com/ts/product/00/40/a9/61e229ef1e71954bac204d149df20f54.jpg">
    </div> 
    <h4 class="a-spacing-mini"> Making Statements </h4> 
    <p class="a-size-small"> The expertise and execution in design as well as case construction is intrinsic to our inventive reputation and style. With this forward thinking energy, Invicta is fully equipped to suit and satisfy the most particular and diverse of tastes. The aim is to always achieve creative articulations in time from different points of view. </p> 
   </div> 
   <div class="a-section"> 
    <div class="a-section a-text-center"> 
     <img alt="" src="https://salt.tikicdn.com/ts/product/1a/03/4e/80692943f5a3132040ce329d9927ee7f.jpg">
    </div> 
    <h4 class="a-spacing-mini"> Setting A Precedent </h4> 
    <p class="a-size-small"> Taking the meticulous art of case construction to new levels, Invicta is now recognized as the masters of case complications. Because of the exceptional engineering found in each model, technical revelations deliver outstanding performance in every watch. The brand now grown to encompass over 30 diverse collections. </p> 
   </div> 
   <div class="a-section"> 
    <div class="a-section a-text-center"> 
     <img alt="" src="https://salt.tikicdn.com/ts/product/f0/fe/e4/08d2b89576d4c1485d0af1bdfa0f2a72.jpg">
    </div> 
    <h4 class="a-spacing-mini"> Innovation In Motion </h4> 
    <p class="a-size-small"> Utilizing high quality materials generally found only in high-priced brands, each timepiece is crafted and rigorously tested to ensure optimum standards. From skeletonised movements to a unique gold layering technique to exceptional construction, Invicta has become one of the most technically capable watch makers in the world. </p> 
   </div> 
  </div> 
 </div> 
