<p>Kính râm TS Phân cực Phi công UV400 Kính bảo vệ Nam nữ Kính mắt lái xe cho du lịch ngoài trời Màu xám</p>
<p>Tính năng:<br />- Chống tia cực tím UV400, lý tưởng cho các hoạt động ngoài trời như leo núi, lái xe, câu cá, đi bộ đường dài và du lịch.<br />- Gọng kính được làm bằng thép không gỉ với công nghệ liền khối và thấu kính TAC cho phong cách và thanh lịch hơn.<br />- Lớp phủ tự sửa chữa (trong vòng 20 micromet vết xước) làm cho kính râm của bạn như mới.<br />- Lớp phủ 6 lớp giúp ngăn chặn hơn 99% tia UV, bảo vệ nhiều lớp cho đôi mắt của bạn.<br />- Chân kính râm hình chữ Z tiện dụng vừa vặn với dáng người.<br /><span class="">- Đệm mũi TPR mềm mại, thoải mái dựa vào mũi của bạn.</span><br />- Thích hợp cho cả nam và nữ.</p>
<p>Thông số kỹ thuật:<br />Thương hiệu: TS<br />Chất liệu khung: Thép không gỉ<br />Chất liệu ống kính:<br />Ống kính TAC Chiều rộng ống kính: 54mm / 2,1in<br />Chiều cao ống kính: 54mm / 2,1in<br />Chiều dài chân: 145mm / 5,7in<br />Chiều rộng chân kính: 19mm / 0,7in<br />Chiều rộng kính: 145mm / 5,7in</p>
<p>Danh sách gói:<br />1 * Kính râm</p>
