insert into Products values('40949590','SPL01','CT16','RT01', 'Đồng Hồ Nam Orient 'Sun and Moon Version 3' - FAK00001Y0, FAK00002S0, FAK00004B0, FAK00005D0','https://salt.tikicdn.com/cache/280x280/ts/product/ad/e4/ad/5fcf4abb415fbd697d4f3ef15d4b3d72.jpg', 1237700,'<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://salt.tikicdn.com/ts/tmp/3d/da/ec/dd9c1b9a6e7736a7248ba72929519677.jpg" alt="Đồng Hồ Tự Động Orient 'Sun and Moon Phiên Bản 3' FAK00001Y0, FAK00002S0, FAK00004B0, FAK00005D0" width="750" height="231" /></p>
<h5><strong>Giới thiệu về đồng hồ Orient </strong></h5>
<ul>
<li>Đã sản xuất đồng hồ hơn 65 năm.</li>
<li>Tất cả các chuyển động và chi tiết của đồng hồ được sáng tạo và sản xuất tại Nhật Bản.</li>
<li>Bộ máy của đồng hồ được sản xuất bằng chất lượng cao nhất, thể hiện niềm đam mê thật sự của Orient về chế tạo đồng hồ.</li>
</ul>
<h5><strong>The Sun &amp; Moon V</strong><strong>ersion III</strong></h5>
<p><strong><img style="display: block; margin-left: auto; margin-right: auto;" src="https://salt.tikicdn.com/ts/tmp/76/08/5d/0617ac2fb468c755568142818b8d64d3.jpg" alt="Đồng Hồ Tự Động Orient 'Sun and Moon Phiên Bản 3' FAK00001Y0, FAK00002S0, FAK00004B0, FAK00005D0" width="452" height="458" /></strong></p>
<ul>
<li>Dòng đồng hồ <strong>Orient Sun and Moon</strong> (Orient Sun &amp; Moon) được giới thiệu lần đầu vào năm 2014. Chúng thuộc phân khúc cao cấp của hãng Orient, Nhật Bản. Hầu hết các mẫu vận hành bằng máy Automatic và có chức năng Sun and Moon cho biết thời gian Ngày hay Đêm đặc trưng.</li>
<li>Năm 2017 là năm chuyển mình sâu sắc của dòng Orient Sun And Moon khi nó được nâng cấp lên một bộ máy automatic mới, Cal. F6B24, bổ sung tính năng lên dây thủ công và hacking second so với Cal. 46B46 cũ. Theo đó, <strong>Orient Sun And Moon Version 3</strong> (Gen 3) ra đời.</li>
</ul>
<h5><strong>CÁCH HOẠT ĐỘNG CỦA CHỨC NĂNG SUN AND MOON</strong></h5>
<p style="text-align: center;"><strong><img src="https://salt.tikicdn.com/ts/tmp/26/c5/35/95fff820728f60df2c02c636a8ce092d.jpg" alt="Đồng Hồ Tự Động Orient 'Sun and Moon Phiên Bản 3' FAK00001Y0, FAK00002S0, FAK00004B0, FAK00005D0" width="541" height="418" /></strong></p>
<ul>
<li>Sun and Moon còn gọi là Ngày và Đêm (Day and Night), chúng cho biết thời gian hiện tại của đồng hồ là sáng hay chiều, tương đương chức năng Đồng Hồ 24 Giờ. Chức năng được trình bày dưới dạng một đĩa tròn, một nửa được in hình Mặt Trời và bầu trời xanh, một nửa in hình Mặt Trăng, sao và bầu trời đêm.</li>
<li>Đĩa tròn in hình Mặt Trời Mặt Trăng sẽ được đặt bên dưới ô cửa sổ có hình đám mây, xoay liên tục một cách chậm rãi, một vòng xoay sẽ kéo dài đúng 24 tiếng. Hằng ngày, cứ 6 giờ sáng thì mặt trời sẽ dần xuất hiện qua ô cửa sổ, đến 6 giờ tối thì mặt trời biến mất hoàn toàn và mặt trăng dần xuất hiện.</li>
<li>Chức năng Sun and Moon sẽ được đồng bộ với Giờ Phút (không chỉnh riêng được). Ngoài ra, ta có thể theo dõi Sun and Moon để đảm bảo việc thiết đặt Lịch nhảy đúng buổi-đúng ngày.</li>
<li>Nhà sản xuất Orient cảnh báo khách hàng <strong>không được chỉnh giờ</strong> trong khung giờ từ <strong>9.00 PM</strong> – <strong>2.00 AM</strong> của đồng hồ. Điều này sẽ hạn chế việc nhảy sai lịch và giảm nguy cơ hỏng bộ máy về sau.</li>
</ul>
<h5><strong>Các đặc điểm nổi bật của đồng hồ Orient Sun and Moon version 3 </strong></h5>
<ul>
<li>Bao gồm tất cả các đặc điểm nổi bật của <span style="color: #000000;">đồng hồ <strong>Orient Sun and Moon version 2</strong> </span></li>
<li>Chức năng Sun and Moon đặt ở vị trí 5 giờ, Lịch Ngày là khung cửa sổ kéo dài ở 7-8 giờ.</li>
<li>Vận hành các mẫu <strong>Orient Sun and Moon Version 3</strong> là bộ máy F6B24 22 chân kính, tần số dao động 21600 A/h, thời gian trữ cót khoảng hơn 40 giờ, lắp ráp thủ công 100% tại Nhật Bản. Đây là bộ máy Automatic thế hệ mới của Orient, có thể lên dây thủ công và có hacking second (rút núm chỉnh thời gian kim giây sẽ ngừng lại).</li>
<li>Riêng với Version 3 trở đi, có thể lên dây thủ công bằng cách vặn núm chỉnh (khi ở vị trí đóng) theo chiều kim đồng hồ khoảng 30 vòng mỗi ngày là ổn, không cần đeo ít nhất 8 tiếng/ngày để đồng hồ chạy chính xác.</li>
<li>Các mẫu <strong>Orient Sun and Moon Version 3</strong> đều có đường kính 42.5mm x độ dày 14 mm. Mỏng hơn Version 2 dù chỉ một chút nhưng điều đó cũng nói lên được những cố gắng cải tiến của hãng đối với dòng sản phẩm con cưng này.</li>
</ul>
