insert into Products values('40323156','SPL01','CT16','RT01', 'Đồng Hồ Casio AQS800WD-1EV Tough Solar Dùng Năng Lượng Mặt Trời Với Màn Hình Kỹ Thuật Số Analog ','https://salt.tikicdn.com/cache/280x280/ts/product/7c/90/f4/56c86d826fa30accd44edb6cde94f48c.jpg', 1237700,'<div id="prodDetails">
<h2 class="t-size-x-large underline printNomargin">Tough Solar là gì ?</h2>
<em><strong>Tough Solar</strong></em> là công nghệ chuyển hóa năng lượng không chỉ ánh sáng mặt trời, mà thậm chí từ các nguồn ánh sáng yếu khác như đèn huỳnh quang.</div>
<div> </div>
<div>Để làm được điều này, các dòng đồng hồ <strong>Tough Solar</strong> sử dụng một tấm pin năng lượng ánh sáng được gắn trên mặt số. Ánh sáng được tấm pin hấp thụ, một phần để duy trì hoạt động cho đồng hồ. Phần còn lại sẽ sạc vào một viên pin để sử dụng khi đồng hồ không được tiếp xúc với ánh sáng.</div>
<div>
<p>Đặc biệt, ngoài năng lượng từ ánh mặt trời, đồng hồ có <strong>Tough Solar</strong> còn có thể hấp thụ những nguồn sáng yếu như ánh điện, đèn huỳnh quang,…</p>
<p style="text-align: center;"><img src="https://salt.tikicdn.com/ts/tmp/c8/65/84/27bc76d9246d86f4f3feae0668242dc5.jpg" alt="Đồng Hồ Casio AQS800WD-1EV Dùng Năng Lượng Mặt Trời Với Màn Hình Kỹ Thuật Số Analog " width="501" height="207" /></p>
<p style="text-align: left;">Nếu Seiko có Seiko Solar, Citizen có Eco-Drive thì Casio có <strong>Tough Solar</strong> - 3 trong 4 ông lớn đồng hồ Nhật đều sở hữu những công nghệ ánh sáng riêng. Tuy nhiên, thay vì sản xuất riêng biệt 1 dòng đồng hồ công nghệ ánh sáng như Seiko và Citizen, Casio lại tích hợp <strong>Tough Solar</strong> rộng rãi trong các bộ sưu tập của mình. Không phải đồng hồ Casio nào cũng áp dụng điều này. Những chiếc đồng hồ Casio chạy năng lượng ánh sáng đều có dòng chữ “<strong>Tough Solar</strong>” trên mặt số.</p>
<p style="text-align: center;"><img src="https://salt.tikicdn.com/ts/tmp/c7/41/9a/2a28002998698cf504ab2123a35b58d2.jpg" alt="Đồng Hồ Casio AQS800WD-1EV Dùng Năng Lượng Mặt Trời Với Màn Hình Kỹ Thuật Số Analog " width="573" height="384" /></p>
