  <p>Water-resistant to 660 feet (200 M)</p>
  <p></p>
  <p>Casio's corporate creed is "creativity and contribution." It expresses the company's commitment to contributing to society by offering the kind of original, useful products that only Casio can. Products with innovative functions assist people in their daily lives and keep society moving forward. They also bring joy to people and help to create new culture. When even a single new product is widely adopted, whole new markets develop, and this in turn fosters growth in related industries. This is the story of Casio's contribution to society-innovative products enhancing people's lives. Inspiration finally came to the engineer, who had never given up experimenting, on a day off just before the development deadline. After going out to lunch feeling low, he was watching some children playing with a rubber ball in the park next to the research and development center when the idea of the module floating in the space inside the ball suddenly came to him. In order to realize this concept, he came up with a hollow structure in which the module is supported at just a few points with a slight space around it.</p>
  <p>Complete with a digital compass, Casio's Twin Sensor Watch #SGW100B-3V boasts innovative technology and sporty digital style. Temperature and direction readings make this rugged timepiece ideal for workouts, outdoor adventures, and water sports. There's also world time (29 time zones/48 cities), magnetic declination correction, a 1/100-second stopwatch, four daily alarms and one snooze alarm, auto calendar pre-programmed until the year 2099, and a mineral glass for extra protection against scratching. Direction readings and time are indicated on a large LCD that is divided into three segments for a clear, easy-to-understand display. Water resistance to 660 feet and a rugged resin band ensure durability, while digital quartz movement provides reliable precision.</p>
  <p>With the launch of its first watch in November 1974, Casio entered the wristwatch market at a time when the watch industry had just discovered digital technology. As a company with cutting-edge electronic technology developed for pocket calculators, Casio entered this field confident that it could develop timepieces that would lead the market.</p>
  <p>Today, Casio is focusing its efforts on solar-powered radio-controlled watches: the built-in solar battery eliminates the nuisance of replacing batteries, atomic timekeeping means the users never have to reset the time. Recently, Casio launched a series of Bluetooth watches that sync to the users cell phone to automatically update the time. Casio is always moving time forward.</p>
